// src/components/ViewersList.js
import React from 'react';

const ViewersList = ({ viewers, onBack }) => (
  <div>
    <h2>Viewers List</h2>
    {viewers.length === 0 ? (
      <p>No viewers found.</p>
    ) : (
      <ul>
        {viewers.map((viewer) => (
          <li key={viewer.id}>
            {viewer.firstName} {viewer.lastName} (ID: {viewer.id})
          </li>
        ))}
      </ul>
    )}
    <button onClick={onBack}>Back to Admin Options</button>
  </div>
);

export default ViewersList;
